import { Route, BrowserRouter, Routes } from "react-router-dom";

export default function AplicationRoutes() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<h1>Teste</h1>} />
      </Routes>
    </BrowserRouter>
  );
}
